import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (
      <div className='backgr'>
        <nav>    
        <u id="nav">  
            <h3>Train Route Management</h3><br/>

          <li><NavLink to="/routes">Routes</NavLink></li><br/><br/>
          <li><NavLink to="/trains">Trains</NavLink></li><br/><br/>
          <li><NavLink to="/station">Stations</NavLink></li><br/><br/>
          <li><NavLink to="/station">Time setings</NavLink></li><br/><br/>
        </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
